        //     }
        //   }
        // );

        domainList.forEach(function (element) {
          check(
            element,
            function () {
              if (success) {
                return;
              }
              success = true;
              location.href = element;
            },
            function () {
              index++;
              if (domainList.length <= index) {
                $("#error-page").removeClass("hide-page").addClass("show-page");
                $("#load-page").removeClass("show-page").addClass("hide-page");
              }
            }
          );
        });
      }

      //   setTimeout(() => {
      //     main();
      //   }, 1000);
      main();
      function check(domain, success, error) {
        $.ajax({
          url: domain,
          success() {
            success();
          },
          error() {
            error();
          },
          cache() {
            error();
          },
        });
      }
    </script>
  </body>
</html>
